import styled from 'styled-components'

export const StyledCard = styled.section`



img{
    height: 100px;
}

button{
    font-size: 15px;
    margin-left: 10px;
    font-family: 'Poppins', sans-serif;

}

.recipecard{
    display: flex;
    flex-direction: column;
    align-items: center;
    margin-top: 30px;
    
}

.prueba{
    background-color: #DFDDDE;
    width: 230px;
    border-radius: 10px;
    text-align: center;
    padding: 10px 0px 10px 0px;

    
    
}

`
